export interface Images {
    pageName: string;
    src: string;
    id: number;
  }

  const ProductImages: Images[] = [
    {
      pageName:'ST1',
      src: 'assets/productImages/Allart-Select-ST1-01.jpg',
      id: 0
    },
    {
        pageName:'ST1',
        src: 'assets/productImages/Allart-Select-ST1-02.jpg',
        id: 1
      },
  ];

  export const getProductImages = () => ProductImages;

  export const getProductImage = (id: number) => ProductImages.find(m => m.id === id);
